    .clearfix {
        display: block
    }

    .clearfix:after,
    .clearfix:before {
        clear: both;
        content: ".";
        display: block;
        height: 0;
        visibility: hidden
    }

    #okta-sign-in {
        border-radius: 3px;
        border-style: solid;
        border-width: 1px;
        font-size: 14px;
        font-weight: 400;
        height: auto;
        line-height: 1.4;
        margin: 100px auto 8px;
        min-width: 300px;
        overflow: auto;
        position: relative;
        width: 400px
    }

    #okta-sign-in:focus {
        outline: none
    }

    @media only screen and (max-device-width:480px) {
        #okta-sign-in {
            margin-top: 0;
            width: 100%
        }
    }

    @media only screen and (max-width:400px) {
        #okta-sign-in {
            width: 100%
        }
    }

    @media only screen and (max-height:750px) {
        #okta-sign-in {
            margin-top: 0
        }
    }

    #okta-sign-in.no-beacon .auth-content {
        padding-top: 20px
    }

    #okta-sign-in.no-beacon .auth-header {
        padding-bottom: 30px
    }

    @media only screen and (max-width:560px) {}

    @media only screen and (max-width:400px) {}

    .login-bg-image {
        background-position: 50%;
        background-repeat: no-repeat;
        background-size: cover;
        bottom: 0;
        left: 0;
        position: fixed;
        right: 0;
        top: 0;
        z-index: -5
    }

    @media only screen and (max-width:400px) {}

    @media only screen and (max-height:750px) {}

    @media only screen and (max-height:660px) {}

    #okta-sign-in [class*="-16"] {
        -moz-box-sizing: border-box;
        -webkit-box-sizing: border-box;
        box-sizing: border-box;
        vertical-align: top
    }

    #okta-sign-in [class*="-16"]:after,
    #okta-sign-in [class*="-16"]:before,
    #okta-sign-in [class^="-16"]:after,
    #okta-sign-in [class^="-16"]:before {
        -moz-osx-font-smoothing: grayscale;
        -webkit-font-smoothing: antialiased;
        font-smoothing: antialiased;
        speak: none;
        display: block;
        font-family: okticon;
        font-size: 16px;
        font-style: normal !important;
        font-weight: 300 !important;
        position: absolute;
        text-indent: 0;
        white-space: normal
    }

    #okta-sign-in .error-16-red:before,
    #okta-sign-in .error-16-small:before {
        color: #e34843;
        content: ""
    }

    #okta-sign-in a,
    #okta-sign-in div,
    #okta-sign-in form,
    #okta-sign-in h1,
    #okta-sign-in h2,
    #okta-sign-in img,
    #okta-sign-in label,
    #okta-sign-in p,
    #okta-sign-in span,
    #okta-sign-in ul {
        background: transparent;
        border: 0;
        font-size: 100%;
        font: inherit;
        margin: 0;
        outline: 0;
        padding: 0;
        vertical-align: baseline
    }

    #okta-sign-in ul {
        list-style: none
    }

    #okta-sign-in :focus {
        outline: 0
    }
